  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bear River Migratory
  Bird Refuge outlines Refuge accomplishments from November, 1940 through January,
  1941. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including waterbirds, upland game birds, furbearers,
  predators, fish, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments and collections and receipts. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, hunting, and violations.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
